Defendant Calvin Lamar Davis in court with attorney Joseph Thomas Domask via Zoom.  Anthony Jackson appeared for the State of Wisconsin via Zoom.
Court finds State has complied with victim notification.  Sentencing hearing proceeded.  Statements made as to sentencing.

As to Count 2: The court sentenced the defendant to 90 DAYS in the House of Correction, with credit for 3 DAYS time served.  

Court STAYED sentence and placed defendant on PROBATION for 12 MONTHS with the possibility of shortening to 7 months if compliant with conditions of probation and approved by agent.
CONDITIONS OF PROBATION:
-Batterers Intervention program;
-Mental health evaluation, comply with recommended treatment;
-No violent contact with victim;
-Obtain/maintain employment;
-Provide DNA sample;
-Pay all supervision fees, court costs, fees, and surcharges including: DNA & DV surcharges during period of probation.  Unpaid amount to convert to a civil judgment;  
-Restitution set at ZERO
-Court advised that once Attorney Domask submits attorney's fees to the court, and once approved, defendant to pay at a rate of $50.00 per month beginning 6/1/2021 and every month thereafter until paid in full. Failure to pay will result in a civil judgment. 

*Court advised defendant of right to seek post conviction relief.
*Court advised that under 18 USC Section 922(g)(9) the defendant is prohibited from possession of a firearm and/or ammunition after conviction of a crime of domestic violence.

Filed: 
